    "2015-09-26T23:56:26.851850",nt"name": "2012-usgs-lidar-brooks-camp-ak",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Geological Survey (USGS) had a
    requirement for high resolution Lidar needed for mapping the Brooks Camp region
    of Katmai National Park in Alaska. Aero-Metric, Inc. (AeroMetric) acquired highly
    accurate Lidar data for an area that comprises of approximately 17.5 square miles
    for the USGS. This acquisition was carried out to satisfy the need for high resolution
    elevation data in the region. A Leica ALS70 Lidar system was used in the collection
    of data for this project. This project involves new Lidar data acquisition at an
    approximate pulse spacing of 0.6 meters. This data was to be calibrated such that
    all systematic errors were accounted for. The project required bare-earth classification
    and hydroenforcement of water bodies for the production of contours and digital
    elevation models. Data was to conform to a vertical accuracy of 18.5 cm RMSE in
    open terrain. The accuracy as tested and published in this report has met vertical
    accuracy requirements as specified by the client.",nt"license_title": null,nt"extras":
